import TileArea from "./TileArea";
import "./TileArea.css";

function TileCard(props) {
  return (
    <div>
      <User name={props.name} />
      <UserJob job={props.job} />
      <UserHobby hobby={props.hobby} />
    </div>
  );
}

export default TileCard;
